class h{constructor(t){this.m=2147483648,this.a=1103515245,this.c=12345,this.state=t||1}nextInt(){return this.state=(this.a*this.state+this.c)%this.m,this.state}nextFloat(){return this.nextInt()/(this.m-1)}nextRange(t,n){const r=n-t,s=this.nextInt()/this.m,e=t+(s*r|0);if(isNaN(e))throw new Error("rand nan");return e}chooseIndex(t){const n=t.reduce((e,o)=>e+o),r=this.nextRange(1,n+1);let s=0;for(let e=0;e<t.length;e++)if(s+=t[e],r<=s)return e;return t.length-1}chooseKey(t){const n=Object.keys(t),r=n.map(s=>t[s]);return n[this.chooseIndex(r)]}}export{h as R};
